&lt;p&gt;Componentes:&lt;br&gt;&lt;br&gt;L-Carnitina, espirulina, alcachofa, hierbabuena, t&eacute; Verde.&lt;br&gt;&lt;br&gt;Dentro de sus componentes se encuentra el T&eacute; verde, una poderosa planta que cuenta con m&uacute;ltiples beneficios, es por esta raz&oacute;n que est&aacute; presente en varias culturas ya que lo consumen porque es rico en antioxidantes, es un regulador hep&aacute;tico y ayuda a reducir el exceso de acumulaciones corporales. Es un apoyo recomendado para regular la digesti&oacute;n cr&oacute;nica. &lt;br&gt;La combinaci&oacute;n de la L Carnitina y la spirulina junto con el t&eacute; verde hacen que su cuerpo se libere de aquellos excesos que no le permiten tener buena salud corporal. &lt;br&gt;&lt;br&gt;El Uno A Plus ayuda a eliminar toxinas de forma general.&lt;br&gt;&lt;br&gt;Su forma de consumo recomendada es tomar dos c&aacute;psulas en ayunas con una infusi&oacute;n caliente natural de plantas y frutas Irene Melo. &lt;br&gt;&lt;br&gt; Suplemento Dietario con Registro Invima &lt;br&gt;SD 2011-0001936 &lt;br&gt;&lt;br&gt;(Muchos cient&iacute;ficos en el mundo contin&uacute;an investigando sobre los beneficios de los recursos naturales en la humanidad)&lt;/p&gt;
